def set_text(e,text):
    e.delete(0,END)
    e.insert(0,text)
    return

def select_file(e):
    filetypes = (
        ('image files', '.png'),
        ('image files', '.jpg'),
    )

    filename = fd.askopenfilename(
        title='Open a file',
        initialdir='/',
        filetypes=filetypes)

    set_text(e, filename)

